import React from 'react';
import { StyleSheet } from 'react-native';

const Styles = StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: '#fff',
      alignItems: 'center',
      justifyContent: 'center',
    },

    boldText25:{
        fontWeight: 'bold'

    }, 
    horizontal_align:{
        flexDirection: 'row'
    },
    text: {
      height: 40,
      margin: 12,
    },
    input: {
      height: 40,
      margin: 12,
      borderWidth: 1,
    }

  });

  export default Styles;
